import React, {Component} from "react";
import "./sorts.css";
import axios from 'axios';
import { connect } from 'react-redux';

class Sorts extends Component{
    constructor(props){
        super(props)

        this.state = {
            sorts: []
        }
    }

    componentDidMount(){
        axios.get("http://localhost:"+this.props.app.port+"/api/get_main_sorts").then(response => {
            this.setState(state => ({
                sorts: response.data.result
            }))
        })
    }

    render(){
        return(
            <div className="sorts">
                sorts
            </div>
        )
    }
}

const mapStateToProps = (state) => {
return state;
}
const mapDispatchToProps =  (dispatch) => {
return {
    // "setTest": (data) => dispatch(setTest(data))
}
}
export default connect(mapStateToProps, mapDispatchToProps)(Sorts)
